import { useEffect, useState } from "react";

function App() {
    const [pyodide, setPyodide] = useState(null);
    const [output, setOutput] = useState("");

    useEffect(() => {
        const initPyodide = async () => {
            try {
                console.log("Loading Pyodide...");

                // Load Pyodide script dynamically
                const pyodideScript = document.createElement("script");
                pyodideScript.src = "/pyodide/pyodide.js";  // Ensure correct path
                pyodideScript.onload = async () => {
                    console.log("Pyodide script loaded, initializing...");
                    try {
                        const pyodideInstance = await window.loadPyodide({
                            indexURL: "/pyodide/",
                        });
                        console.log("Pyodide initialized successfully!");
                        setPyodide(pyodideInstance);
                    } catch (error) {
                        console.error("Pyodide initialization failed:", error);
                    }
                };
                pyodideScript.onerror = () => {
                    console.error("Failed to load pyodide.js!");
                };
                document.body.appendChild(pyodideScript);
            } catch (error) {
                console.error("Unexpected error loading Pyodide:", error);
            }
        };
        initPyodide();
    }, []);

    const runPython = async () => {
        if (!pyodide) {
            console.error("Pyodide not initialized yet!");
            return;
        }
        console.log("Running Python...");
        const result = pyodide.runPython("2 + 2");
        setOutput(result);
    };

    return (
        <div>
            <button onClick={runPython} disabled={!pyodide}>Run Python</button>
            <p>Output: {output}</p>
        </div>
    );
}

export default App;
